import React from 'react'
import Axios from "axios";


export default function NormalUser() {

    useEffect(() => {
        Axios.get("http://localhost:3001/api/Profile")
    }, [])

    


    return (
        <div>
            <h1>User</h1>
            <img src="https://cdn.pixabay.com/photo/2018/04/18/18/56/user-3331257__340.png"></img>
        </div>
    )
}
